import React from "react";
import "../../../App.css";
import "./Contact.css";

function Contact() {
  return (
    <div className="contact">
      <h2>Contact Us</h2>
      <p>Drmz System Innovations</p>
      <p>First Floor, Plot 69B, Kasturba Nagar</p>
      <p>Bhopal, MP 462023</p>
      <p>Email: contact@drmztech.com</p>
      <p>Phone: +91-7581806218</p>
    </div>
  );
}
export default Contact;
